(function(){var app=angular.module("app");app.factory("httpInterceptor",["$q","$location","tokenStorage","routeChecker",function($q,$location,tokenStorage,routeChecker){return{request:function(request){var rCh=routeChecker();if(rCh.isPrivate()){var tokenObj=tokenStorage.getToken();if(tokenObj===undefined){$location.path("/signin")}}request.headers["x-access-token"]=tokenStorage.getAccessHeader();return request},requestError:function(rejection){return $q.reject(rejection)},response:function(response){return response},responseError:function(rejection){if(rejection.status===401){$location.path("/signin")}return $q.reject(rejection)}}}])})();